    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 539,
           NT_OFFSET         = 123,
           LA_STATE_OFFSET   = 5920,
           MAX_LA            = 2147483647,
           NUM_RULES         = 536,
           NUM_NONTERMINALS  = 202,
           NUM_SYMBOLS       = 325,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 3574,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 121,
           EOLT_SYMBOL       = 121,
           ACCEPT_ACTION     = 5022,
           ERROR_ACTION      = 5384;

